def getMap(s):
    refer = dict()
    res = json.loads(s)
    clazz_1_list = res["children"]

    for clazz_1 in clazz_1_list:
        clazz_1_id = clazz_1["id"]
        clazz_1_title = clazz_1["title"]

        refer[clazz_1_title] = dict()

        clazz_2_list = clazz_1["children"]

        for clazz_2 in clazz_2_list:
            clazz_2_id = clazz_2["id"]
            clazz_2_title = clazz_2["title"]

            refer[clazz_1_title][clazz_2_title] = []

            clazz_3_list = clazz_2["children"]

            for clazz_3 in clazz_3_list:
                refer[clazz_1_title][clazz_2_title].append(clazz_3["title"])
    return refer


